import React, { useState } from "react";


const MySelect = ({options, defaultValue, value}) => {
    return (
    <select value={value}>
        <option disabled value="">{defaultValue}</option>
        {options.map(option =>
            <option key={option.value} value={option.value}>
                {option.name}
            </option>
        )}
    </select>
    );
};

export default MySelect;
